// src/pages/delivery/DeliveryDashboard.jsx
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../../context/AuthContext';
import '../../styles/delivery/DeliveryDashboard.css';

const DeliveryDashboard = () => {
  const { user } = useAuth();
  const [dashboardData, setDashboardData] = useState({
    activeDelivery: null,
    deliveredToday: 0,
    totalEarningsToday: 0,
    isActive: false,
    availableOrders: 0,
    recentDeliveries: []
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        setLoading(true);
        const token = localStorage.getItem('token');

        if (!token) {
          throw new Error('No authentication token found');
        }

        const response = await axios.get('http://localhost:8080/api/delivery/dashboard', {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });

        console.log('Dashboard Response:', response.data);

        if (response.data) {
          setDashboardData({
            activeDelivery: response.data.activeDelivery || null,
            deliveredToday: response.data.deliveredToday || 0,
            totalEarningsToday: response.data.totalEarningsToday || 0,
            isActive: response.data.active || false,
            availableOrders: response.data.availableOrders || 0,
            recentDeliveries: response.data.recentDeliveries || []
          });
        } else {
          throw new Error('Invalid dashboard data');
        }

        setLoading(false);
      } catch (err) {
        console.error('Full error details:', err);

        const errorMessage = err.response?.data?.message || 
                             err.message || 
                             'Failed to fetch dashboard data. Please try again later.';

        setError(errorMessage);
        setLoading(false);
      }
    };

    fetchDashboardData();

    // Refresh data every minute
    const interval = setInterval(fetchDashboardData, 60000);
    return () => clearInterval(interval);
  }, []); 

  // Toggle active status method
  const toggleActiveStatus = async () => {
    try {
      const token = localStorage.getItem('token');
      const newStatus = !dashboardData.isActive;

      await axios.post('http://localhost:8080/api/delivery/toggle-status', 
        { isActive: newStatus },
        {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        }
      );

      // Update local state
      setDashboardData(prev => ({
        ...prev,
        isActive: newStatus
      }));
    } catch (err) {
      setError('Failed to update your status. Please try again.');
      console.error('Error toggling status:', err);
    }
  };

  if (loading) {
    return (
      <div className="delivery-loading-container">
        <p>Loading dashboard data...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="delivery-loading-container">
        <p className="text-red-500">{error}</p>
        <button 
          onClick={() => window.location.reload()}
          className="mt-4 px-4 py-2 bg-blue-500 text-white rounded"
        >
          Retry
        </button>
      </div>
    );
  }

  return (
    <div className="delivery-dashboard-container">
      <div className="delivery-dashboard-header">
        <h1>Delivery Dashboard</h1>
        <p>Welcome back, {user?.name || 'Delivery Partner'}</p>
      </div>

      <div className="delivery-stats-container">
        <div className="delivery-stat-card">
          <h3>Completed Today</h3>
          <p className="stat-value">{dashboardData.deliveredToday}</p>
        </div>
        <div className="delivery-stat-card">
          <h3>Today's Earnings</h3>
          <p className="stat-value">${dashboardData.totalEarningsToday.toFixed(2)}</p>
        </div>
        <div className="delivery-stat-card">
          <h3>Available Orders</h3>
          <p className="stat-value">{dashboardData.availableOrders}</p>
        </div>
        <div className="delivery-stat-card">
          <h3>Status</h3>
          <p className="stat-value">
            {dashboardData.isActive ? 'Online' : 'Offline'}
          </p>
        </div>
      </div>

      <div className="delivery-actions-container">
        <Link 
          to="/delivery/available-orders" 
          className="delivery-action-button primary"
        >
          View Available Orders
        </Link>
        <button 
          onClick={toggleActiveStatus}
          className={`delivery-action-button ${dashboardData.isActive ? 'secondary' : 'primary'}`}
        >
          {dashboardData.isActive ? 'Go Offline' : 'Go Online'}
        </button>
      </div>

      <div className="recent-deliveries-container">
        <h2>Recent Deliveries</h2>

        {dashboardData.recentDeliveries.length > 0 ? (
          <div className="recent-deliveries-list">
            {dashboardData.recentDeliveries.map(delivery => (
              <div key={delivery.orderId} className="delivery-item">
                <div className="delivery-item-header">
                  <h3>{delivery.restaurantName}</h3>
                  <span className="delivery-status">Completed</span>
                </div>
                <div className="delivery-item-details">
                  <p><strong>Order ID:</strong> #{delivery.orderId}</p>
                  <p><strong>Date:</strong> {new Date(delivery.completedAt).toLocaleDateString()}</p>
                  <p><strong>Earnings:</strong> ${delivery.earnings.toFixed(2)}</p>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <p className="no-deliveries-message">No recent deliveries</p>
        )}
      </div>
    </div>
  );
};

export default DeliveryDashboard;
